	std::vector<InstrInfo*> InstrInfos::AllInfos = ReadInfos();

	std::string InstrInfos::AddSuffix(const std::string& s, std::vector<char>& ca)
	{
		return (s + std::string(ca));
	}

	std::string InstrInfos::AddPrefix(const std::string& s, std::vector<char>& ca)
	{
		return (std::string(ca) + s);
	}

	std::vector<InstrInfo*> InstrInfos::ReadInfos()
	{
		auto reader = DataReader(GetSerializedInstrInfos());
		auto infos = std::vector<InstrInfo*>(IcedConstants::CodeEnumCount);
		auto strings = FormatterStringsTable::GetStringsTable();
		auto ca = std::vector<char>(1);
		std::string s, s2, s3, s4;
		std::uint32_t v, v2, v3;
		std::int32_t prevIndex = -1;
		for (std::int32_t i = 0; i < infos.size(); i++)
		{
			std::uint8_t f = reader.ReadByte();
			auto ctorKind = static_cast<CtorKind>(f & 0x7F);
			std::int32_t currentIndex;
			if (ctorKind == CtorKind::Previous)
			{
				currentIndex = reader.GetIndex();
				reader.SetIndex(prevIndex);
				ctorKind = static_cast<CtorKind>(reader.ReadByte() & 0x7F);
			}
			else
			{
				currentIndex = -1;
				prevIndex = reader.GetIndex() - 1;
			}
			s = strings[reader.ReadCompressedUInt32()];
			if ((f & 0x80) != 0)
			{
				ca[0] = 'v';
				s = AddPrefix(s, ca);
			}
			InstrInfo* instrInfo;
			switch (ctorKind)
			{
			case CtorKind::Normal_1:
				instrInfo = new SimpleInstrInfo(s);
				break;
			case CtorKind::Normal_2:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::AamAad:
				instrInfo = new SimpleInstrInfo_AamAad(s);
				break;
			case CtorKind::AX:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_AX(s, s2);
				break;
			case CtorKind::AY:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_AY(s, s2);
				break;
			case CtorKind::bnd:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_bnd(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::DeclareData:
				instrInfo = new SimpleInstrInfo_DeclareData(static_cast<Code>(i), s);
				break;
			case CtorKind::DX:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_DX(s, s2);
				break;
			case CtorKind::fword:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadByte();
				v2 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_fword(static_cast<CodeSize>(v), static_cast<InstrOpInfoFlags>(v2), s, s2);
				break;
			case CtorKind::Int3:
				instrInfo = new SimpleInstrInfo_Int3(s);
				break;
			case CtorKind::imul:
				instrInfo = new SimpleInstrInfo_imul(s);
				break;
			case CtorKind::invlpga:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_invlpga(static_cast<std::int32_t>(v), s);
				break;
			case CtorKind::CCa_1:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), std::vector<std::string> {s});
				break;
			case CtorKind::CCa_2:
				s2 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), std::vector<std::string> {s, s2});
				break;
			case CtorKind::CCa_3:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), std::vector<std::string> {s, s2, s3});
				break;
			case CtorKind::CCb_1:
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v2), { s }, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::CCb_2:
				s2 = strings[reader.ReadCompressedUInt32()];
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v2), { s, s2 }, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::CCb_3:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				v2 = reader.ReadCompressedUInt32();
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v2), { s, s2, s3 }, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::jcc_1:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_jcc(static_cast<std::int32_t>(v), std::vector<std::string> {s});
				break;
			case CtorKind::jcc_2:
				s2 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_jcc(static_cast<std::int32_t>(v), std::vector<std::string> {s, s2});
				break;
			case CtorKind::jcc_3:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_jcc(static_cast<std::int32_t>(v), std::vector<std::string> {s, s2, s3});
				break;
			case CtorKind::Loopcc1:
				s2 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_cc(static_cast<std::int32_t>(v), std::vector<std::string> {s, s2});
				break;
			case CtorKind::Loopcc2:
				s2 = strings[reader.ReadCompressedUInt32()];
				ca[0] = static_cast<char>(reader.ReadByte());
				v2 = reader.ReadCompressedUInt32();
				s3 = AddSuffix(s, ca);
				s4 = AddSuffix(s2, ca);
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_OpSize_cc(static_cast<CodeSize>(v), static_cast<std::int32_t>(v2), { s, s2 }, std::vector<std::string> {s3, s4});
				break;
			case CtorKind::maskmovq:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_maskmovq(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::memsize:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_memsize(static_cast<std::int32_t>(v), s);
				break;
			case CtorKind::monitor:
				v = reader.ReadByte();
				v2 = reader.ReadByte();
				v3 = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_monitor(s, static_cast<Register>(v), static_cast<Register>(v2), static_cast<Register>(v3));
				break;
			case CtorKind::mwait:
				instrInfo = new SimpleInstrInfo_mwait(s);
				break;
			case CtorKind::mwaitx:
				instrInfo = new SimpleInstrInfo_mwaitx(s);
				break;
			case CtorKind::nop:
				v = reader.ReadCompressedUInt32();
				v2 = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_nop(static_cast<std::int32_t>(v), s, static_cast<Register>(v2));
				break;
			case CtorKind::OpSize_1:
				v = reader.ReadByte();
				ca[0] = 'w';
				s2 = AddSuffix(s, ca);
				ca[0] = 'd';
				s3 = AddSuffix(s, ca);
				ca[0] = 'q';
				s4 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_OpSize(static_cast<CodeSize>(v), s, s2, s3, s4);
				break;
			case CtorKind::OpSize_2:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_OpSize(static_cast<CodeSize>(v), s, s2, s2, s2);
				break;
			case CtorKind::OpSize2:
				s2 = strings[reader.ReadCompressedUInt32()];
				s3 = strings[reader.ReadCompressedUInt32()];
				s4 = strings[reader.ReadCompressedUInt32()];
				v = reader.ReadByte();
				if (v > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_OpSize2(s, s2, s3, s4, v != 0);
				break;
			case CtorKind::pblendvb:
				instrInfo = new SimpleInstrInfo_pblendvb(s);
				break;
			case CtorKind::pclmulqdq:
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_pclmulqdq(s, FormatterConstants::GetPseudoOps(static_cast<PseudoOpsKind>(v)));
				break;
			case CtorKind::pops_2:
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_pops(s, FormatterConstants::GetPseudoOps(static_cast<PseudoOpsKind>(v)));
				break;
			case CtorKind::pops_3:
				v = reader.ReadByte();
				v2 = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_pops(s, FormatterConstants::GetPseudoOps(static_cast<PseudoOpsKind>(v)), static_cast<InstrOpInfoFlags>(v2));
				break;
			case CtorKind::reg:
				v = reader.ReadByte();
				instrInfo = new SimpleInstrInfo_reg(s, static_cast<Register>(v));
				break;
			case CtorKind::Reg16:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_Reg16(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::Reg32:
				v = reader.ReadCompressedUInt32();
				instrInfo = new SimpleInstrInfo_Reg32(s, static_cast<InstrOpInfoFlags>(v));
				break;
			case CtorKind::reverse:
				instrInfo = new SimpleInstrInfo_reverse(s);
				break;
			case CtorKind::ST_STi:
				instrInfo = new SimpleInstrInfo_ST_STi(s);
				break;
			case CtorKind::STi_ST:
				v = reader.ReadByte();
				if (v > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_STi_ST(s, v != 0);
				break;
			case CtorKind::STIG1:
				v = reader.ReadByte();
				if (v > 1)
				{
					throw InvalidOperationException();
				}
				instrInfo = new SimpleInstrInfo_STIG1(s, v != 0);
				break;
			case CtorKind::XLAT:
				ca[0] = 'b';
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_XLAT(s, s2);
				break;
			case CtorKind::XY:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_XY(s, s2);
				break;
			case CtorKind::YA:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_YA(s, s2);
				break;
			case CtorKind::YD:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_YD(s, s2);
				break;
			case CtorKind::YX:
				ca[0] = static_cast<char>(reader.ReadByte());
				s2 = AddSuffix(s, ca);
				instrInfo = new SimpleInstrInfo_YX(s, s2);
				break;
			default:
				throw InvalidOperationException();
			}
			infos[i] = instrInfo;
			if (currentIndex >= 0)
			{
				reader.SetIndex(currentIndex);
			}
		}
		if (reader.GetCanRead())
		{
			throw InvalidOperationException();
		}
		return infos;
	}

